create table quests_steps
(
    Id                        int auto_increment
        primary key,
    QuestId                   int            not null,
    NameId                    int unsigned   not null,
    DescriptionId             int unsigned   not null,
    DialogId                  int            not null,
    OptimalLevel              int            not null,
    Duration                  double(32, 30) not null,
    KamasScaleWithPlayerLevel tinyint        not null,
    KamasRatio                double(32, 30) not null,
    XpRatio                   double(32, 30) not null,
    ObjectiveIdsCSV           mediumtext     null,
    RewardsIdsCSV             mediumtext     null
)
    engine = MyISAM
    charset = utf8;

